// src/components/CarList.js
import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import api from '../api';

function CarList() {
  const [cars, setCars] = useState([]);
  const [search, setSearch] = useState('');

  useEffect(() => {
    const fetchCars = async () => {
      try {
        const response = await api.get(`/cars?search=${search}`);
        setCars(response.data);
      } catch (error) {
        console.error(error);
      }
    };
    fetchCars();
  }, [search]);

  return (
    <div>
      <input type="text" placeholder="Search cars..." value={search} onChange={(e) => setSearch(e.target.value)} />
      <ul>
        {cars.map((car) => (
          <li key={car._id}>
            <Link to={`/cars/${car._id}`}>{car.title}</Link>
          </li>
        ))}
      </ul>
      <Link to="/create">Add New Car</Link>
    </div>
  );
}

export default CarList;
